import React, { useEffect } from "react";

const Rating = ({ bullets = 5 }) => {
  const ratingInput = <span className="border border-cyberPink p-2 rounded" />;
  let bulletsArray = [];
  const printMovieRating = () => {
    for (let i = 0; i < bullets; i++) {
      bulletsArray.push({ id: i });
    }
  };
  useEffect(() => {
    printMovieRating();
  }, []);
  return (
    <div>
      hola
      {bulletsArray.map(() => {
        return { ratingInput };
      })}
    </div>
  );
};

export default Rating;
